  `record_status` enum('l','o','n') NOT NULL DEFAULT 'n' COMMENT '경기 l:live result, o:official result, n:not start',
  `record_team_order` tinyint(3) unsigned NOT NULL COMMENT '릴레이 경기 각 팀별 오더',
  `record_reaction_time` varchar(32) DEFAULT NULL COMMENT '경기 반응시간(트랙계측장비 데이터)',
  `record_group` tinyint(4) DEFAULT NULL COMMENT '경기 조',
  `record_sports` varchar(32) DEFAULT NULL COMMENT '경기 종목',
  `record_round` varchar(32) DEFAULT NULL COMMENT '경기 라운드',
  `record_gender` enum('m','f','c') DEFAULT NULL COMMENT '경기 성별(m:남,f:여,c:혼성)',
  `record_start` datetime DEFAULT NULL COMMENT '경기 시작시간',
  `record_end` datetime DEFAULT NULL COMMENT '경기 마감시간',
  `record_state` enum('n','c','o','y') DEFAULT NULL COMMENT '경기 상태(n:준비 c:취소됨 o:경기중 y:마감)',
  PRIMARY KEY (`record_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

